import React from 'react';
import { Admin, Resource, Edit, SimpleForm, ImageInput, ImageField } from 'react-admin';
import './ImageInputForm.css'

const imageEdit = () => (
    <Edit>
        <SimpleForm>
            <ImageInput source="picture" label="Related pictures" accept={{ 'image/*': ['.png', '.jpg'] }} multiple='false' 
                        placeholder={<p>Drop your face image here!</p>}className="image-input">
                <ImageField source="src" title="title" className="my-image-field" />
            </ImageInput>
        </SimpleForm>
    </Edit>
);


const ImageInputForm = () => {
    return ( 
        <div className='f4 pa2 w-70 center'>
            <Form>
                <ImageInput source="" accept={{ 'image/*': ['.png', '.jpg'] }} multiple='false' placeholder={<p>Drop your face image here!</p>}>
                    <ImageField source="src" title="title" />
                </ImageInput>
            </Form>
        </div>

    )
}

export default ImageInputForm;
